import React from "react";
import { NavLink } from "react-router-dom";

function NavigationBar() {
  return (
    <nav>
      <ul>
        <li>
          <NavLink to="/Login">Login</NavLink>
        </li>
        <li>
          <NavLink to="/Logout">Logout</NavLink>
        </li>
      </ul>
    </nav>
  );
}

export default NavigationBar;
